// SPDX-License-Identifier: MIT
// DecentAPI - 2021
pragma solidity >= 0.5.16 < 0.9.0;

contract Polygonscan_Request {

    uint public price;
    bool public isActive;    
    address admin;


    constructor(){
        admin = msg.sender;

    }

    event PolygonscanParams(
        string module,
        string action,
        string params


        
    );

    function sendPolygonscanParams(string calldata _module, string calldata _action,string calldata _params) external payable {
        if (msg.value < price*1000000000000000 ) {
            revert('Not enough ether');
        }
        
        if (!isActive){
            revert('API inactive, check decentapi.com for status.');
        }


        emit PolygonscanParams(_module, _action,_params);



    }  


    function setPrices(uint _price) external {
        if (msg.sender != admin) {
            revert('wrong owner, cant update');
        }        
        
        price = _price;    



    }

    function setApiState(bool _isActive) external {
        if (msg.sender != admin) {
            revert('wrong owner, cant update');
        }

        isActive = _isActive;


    }



    function transferFunds(address payable recipient, uint256 amount) external {
        if (msg.sender != admin) {
            revert('wrong owner, cant transfer');
        }
        recipient.transfer(amount * 1E18);
    }

    









}
